char* getCharPtr(char* fileName)
{
	char* cp=NULL;
	FILE *fp;
	fp=fopen(fileName,"r");
	if(fp==NULL)
	{
		printf("can't open file");
		exit(0);
	}

	fseek(fp,0,SEEK_END);
	int flen = ftell(fp);
	cp = (char *)malloc(flen + 1);
	if (cp == NULL)
	{
		fclose(fp);
		return 0;
	}
	rewind(fp);
	memset(cp,0,flen+1);
	fread(cp, sizeof(char), flen, fp);
	cp[flen] = 0; 
	return cp;
}

void comment(){
	char c,prev=0;
	flag_mlc = 1;
	while(++yy_cp!=0)
	{
		c=*yy_cp;
		if(c=='/'&&prev=='*')
			return;
		prev=c;
	}
	printf("ERROR: unterminated comment!");
}
